import React from 'react';
import logo from './logo.svg';
import './App.css';
import TodoListHeader from './TodoListHeader';

function App() {
  const todoList = [
    'React practice',
    'game time'
  ];

  return (
    <div className="App">
     <TodoListHeader />
      {
        todoList.map( item => <p>{item}</p>)
      }
    </div>
  );
}

export default App;
